import React from 'react'

function TableData({data}) {

    const columns =  Object.keys(data);
    return (
        <table cellPadding={0} cellSpacing={0}>
            <thead>
                <tr>{columns.map((heading)=> <th>{heading}</th>)} </tr>
            </thead>
            <tbody>
                {data.map((row)=> (
                    <tr>
                        {columns.map((column) => (
                            <td>{row.column}</td>
                        ))}
                    </tr>
                ))}
            </tbody>
        </table>
    )
}

export default TableData
